import React from 'react';
import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip } from 'recharts';

type Game = {
  gameId: string,
  passingAttemptsAmt: number,
  passingCompletionsAmt: number,
  seasonYear: number
}

type PlayerDashboardGamePerformanceLineChartProps = {
  data: Game[]
}

export default ({ data }: PlayerDashboardGamePerformanceLineChartProps) => {
  const dataThisSeason = data.filter((g: Game) => g.seasonYear === 2019);

  return (
    <LineChart width={600} height={300} data={dataThisSeason}>
      <Line type="monotone" dataKey="passingAttemptsAmt" stroke="#8884d8" />
      <CartesianGrid stroke="#ccc" />
      <XAxis dataKey="seasonYear" />
      <YAxis dataKey="passingAttemptsAmt" />
      <Tooltip />
    </LineChart>
  )
}
